                  flexDirection: 'column',
                  minHeight: '100vh'
                }}>
                <Box
                  sx={{
                    p: 3
                  }}>

                  <Header />

                </Box>
                <Box
                  sx={{
                    flex: '1 1 auto',
                    p: 3
                  }}>

                      
                 
                </Box>
                <Box
                  sx={{
                    p: 3
                  }}>

                  Footer

                </Box>
              </Box>

       
        
        </HashRouter>
      );
    }
  }
export default Main;
